        contador++;
        console.log(contador)
    }

    console.log(contador);
    return (
        <>
        <h3>{ props.msg }</h3>
        <h2>{ contador++ }</h2>
        <button onClick = {buttonClick}>Atualizar</button>
        </>
    )
}

export default Body;
